var calendar;

var myVereinCLNDR =
    '<div class="controls">' +
        '<div class="clndr-previous-button">&lsaquo;</div><div class="month"><%= month %></div><div class="clndr-next-button">&rsaquo;</div>' +
    '</div>'+
    '<div class="days-container">'+
        '<div class="days">'+
            '<div class="headers">' +
                '<% _.each(daysOfTheWeek, function(day) { %>' +
                    '<div class="day-header"><%= day %></div>' +
                '<% }); %>' +
            '</div>' +
            '<% _.each(days, function(day) { %>' +
                '<div class="<%= day.classes %>" id="<%= day.id %>"><%= day.day %></div>' +
            '<% }); %>' +
        '</div>' +
        '<div class="events">' +
            '<div class="headers">' +
                '<div class="event-header">EVENTS</div>' +
            '</div>' +
            '<div class="events-list">' +
                '<% _.each(eventsThisMonth, function(event) { %>' +
                    '<div class="event">' +
                        '<a href="<%= event.url %>"><%= moment(event.date).format(\'MMMM Do\') %>: <%= event.title %></a>' +
                    '</div>' +
                '<% }); %>' +
            '</div>' +
        '</div>' +
    '</div>';

function loadEventPage() {
    console.log("Loading event page");
    // assuming you've got the appropriate language files,
    // clndr will respect whatever moment's language is set to.
    // moment.locale('ru');

    // here's some magic to make sure the dates are happening this month.
    var thisMonth = moment().format('YYYY-MM');

    var eventArray = [
        { startDate: thisMonth + '-10', endDate: thisMonth + '-14', title: 'Multi-Day Event' },
        { startDate: thisMonth + '-21', endDate: thisMonth + '-23', title: 'Another Multi-Day Event' },
        { date: thisMonth + '-27', title: 'Single Day Event' }
    ];

    // the order of the click handlers is predictable.
    // direct click action callbacks come first: click, nextMonth, previousMonth, nextYear, previousYear, or today.
    // then onMonthChange (if the month changed).
    // finally onYearChange (if the year changed).

    calendar = $('#calendar').clndr({
        template: myVereinCLNDR,
        events: eventArray,
        clickEvents: {
            click: function(target) {
                if(target.events.length) {
                    console.log(target);
                    var daysContainer = $('#calendar').find('.days-container');
                    daysContainer.toggleClass('show-events', true);
                    $('#mini-clndr').find('.x-button').click( function() {
                        daysContainer.toggleClass('show-events', false);
                    });
                }
            }
        },
        adjacentDaysChangeMonth: true,
        forceSixRows: true
    });

    console.log(calendar);

    // bind both clndrs to the left and right arrow keys
    $(document).keydown( function(e) {
        if(e.keyCode == 37) {
            // left arrow
            calendar.back();
        }
        if(e.keyCode == 39) {
            // right arrow
            calendar.forward();
        }
    });
}